import {Row , Col} from 'react-bootstrap';


function HomeContent() {
    return (
        <div>
          <Row>
              <Col class="First-col">
              <h1>This is some content and bla bla</h1>
              <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Magni consectetur enim odio quae. Nesciunt dolores tempora alias illo eos similique blanditiis dolore, sequi commodi? Temporibus maxime impedit laudantium quaerat expedita?</p>
              </Col>
              <Col class="Second-col"><button>Consult</button></Col>
          </Row>
        </div>
    )
}

export default HomeContent
